import React from "react";
import { HeroContainer, HeroBg, VideoBg } from "./HeroSectionElements";
import Video from "../../videos/webreel_medium.mp4";

const HeroSection = () => {
  return (
    <HeroContainer>
      <HeroBg>
        <VideoBg autoPlay loop muted src={Video} type="video/mp4" />
      </HeroBg>
      <HeroContent>
        <HeroH1>Make your imagination real!</HeroH1>
        <HeroP>Contact me and let's make it real!</HeroP>
        <HeroBtnWrapper>
          <Button to="contactMe">
            Let's Talk! {hover ? <ArrowForward /> : <ArrowRight />}
          </Button>
        </HeroBtnWrapper>
      </HeroContent>
    </HeroContainer>
  );
};

export default HeroSection;
